import styled from "styled-components";
import {flexCenter} from "../../../styles/common";

const S = {};

S.FooterWrapper = styled.div`
    width: 100%;
    background-color: #CF4B05;
    padding: 50px 240px;
`

S.LogoWrapper = styled.div`
    ${flexCenter}
  img {
    width: 183px;
    height: 60px;
  }
`;

export default S;
